import React from 'react';
import './assets/css/bootstrap.css'
import './assets/css/App.css';
import User from './components/User';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="container">
          <div class="row">
            <div class="col-md-7">

            </div>
          </div>
        </div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <User />
      </header>
    </div>
  );
}

export default App;
